        "review_title": "Serves unlimited hot water instantly,Very good,Go for it,Instant heating,Just go for it.,Best for instant heat water,Amazing products,Instant got water, quite literally",
        "review_content": "I bought \"Havells 3lts Instant Geyser 4.5KW White/Blue\" and I'm really happy I made this decision.Let me start with why I went for \"Instant Geyser\" instead of \"Storage Geyser\".-Storage geyser's have a tank to store water and heat it.-For example a 10litre storage geyser fills up the 10 litre tank and then heats the water.-As it has to heat high volume (10 lts) of water it takes time of about 5 to 10 minutes-Instant geyser's on the other hand heat water instantly within 1 to 3 minutes-However the catch is they dont have a huge capacity tank which means at a given instant it has only small volume(depending on tank capacity) of hot waterNow who should opt for \"Instant Geyser\" and who should opt for \"Storage Geyser\" is the question ?- If you like to have a \"Shower Bath\" for which you require more than 10 litres of hot water continously then you should go for \"Storage Geyser\" since storage geyser of capacity more than 10lts will store 10lts of hot water and provide it to you as soon as you turn on the shower without any pauses-Instead if we consider \"Instant Geyser\" of 3lts capacity for shower bath, it cant provide you 10lts of hot water continously because for every 3lts it takes time to heat water again-Hence for a shower bath better to go for \"Storage Geysers\"-If you like to have a \"Bathtub Bath\" then instant geyser's are good to go because-Consider using a bathtub, a bathtub generally is of capacity 350lts-If you even use a \"Storage Geyser\" of high capacity as much as 25lts, still you will have 14 pauses of 5 to 10minutes each-Because at one shot this storage geyser can provide you only 25lts of hot water continously and then you will have to wait for 5-10mins for the next 25lts to heat-So to fill the entire bath tub, you need to have 14 times 25lts of hot water = 350lts-So the total wait time would be 14 times 7mins (on an average) = 98mins-In this scenario of \"Bathtub bath\" its better to go for instant geysers since they provide hot water almost instantly and eventhough there will be pauses for every 3lts of hot water still the pauses being very small you'll have a bathtub full of water with enough amount of heat/hotnessThen you might ask what should we consider for \"Bucket Bath\" ?-Both \"Storage geysers of 15lts or above\" and \"Instant geysers of 3lts or above\" are good to go-Just choose based on:  Price,  Time taken to heat ( instant takes less time ),  Energy consumption ( instant comsumes less )Now coming to \"Havells 3lts Instan Geyser of 4.5KW\", why I bought this ?-Havells is a great brand-I wanted to have it for \"Bathtub Bath\"-4.5KW heats 3lts of water in just 30 to 50secondsWhat I liked about this product:-I have been testing it from a week and it is really ossum as it is heating 3lts of water in just 45seconds ( I have used a timer to note that )-The installation was totally free, however remember you will be charged if there is any \"Plumbing Work\" do be done.-No need to buy any extra accesories like pipes, everything is provided in the box, you just need to buy a 16amp plug which would be less than 100rs-As soon as the product was delivered by amazon, I got a message from havells saying they have registered my installation request and the very next day the instalaltion was done, thanks a lot Havells ( This might differ for you based on your location, I live in hyderabad)-I really like havells customer service-The geyser comes with 2 years of warrenty for the whole and 5yrs of warrenty on the tank-It has \"Auto Cutoff\" feature to stop further heating or wastage of electricity if you forgot to switch off ( however please switch it off once done because eventhough it has auto cutoff, still once the water in the tank cools down it will again start heating and the cycle repeats )-It shows color indication: \"Blue when its heating\" and \"Orange when it has done heating\" ( Have a look at the pictures I have attached)Note:-Go for the 4.5kw model if you want hot water instantly in 30 to 50seconds, the 3kw model might take 2 to 5mins to heat 3lts of water-Make sure it is 4.5kw model because I see reviews from other customers who say the \"Mustard\" colored geyser is not 4.5kw but 3kw ( better go for white and blue color to be sure ),Very nice product,Good product,4.5KW rated heater is able to heat water in minutes and maintain that temperature for continuous flow of hot water. Good product,Great product at great price.,Value for money and instantly warm water comes in just 2min,Havella water heater,Water heats up in 45-60 secs depending on the weather.This review is after using this water heater continuously for 10-12 days in December, in Kolkata, with one of the days being extremely windy and lowest temperature at 14-15 degree Celsius (during afternoon/ early evening hours). On the coldest day so far, it took around 1min &10-15seconds to heat up completely.If you don't have chronic pain, or arthritis, or this is not going to be used for very old people, whereby really hot water is required for bathing, I think it can work perfectly for winters with lowest temperatures upto 9-10 degrees, because I have chronic pain and use this to get really hot water and for a shower, not using a bucket, and it's manageable.Obviously can't be compared to steaming hot showers using a storage geyser, but this heats quite quickly, so can be used in the shower even with the low capacity.For that same reason, it can be used for multiple people, because by the time one person leaves the bathroom and the next enters, you'll have fully hot water, only of lesser quantity, so if you don't live someplace cold, or don't need very hot water but mildly hot water, this can be used for multiple people as well.Installation support was also good.No cons, only that if Havells introduces a 5l instant heater in the 4.5kW range, then that would be a game changer and might give storage geysers a run for their money because this is perfect for anyone who doesn't have their own home and might need to move around, because it's compact, and provides instant hot water.",
