        "review_title": "Works as expected but some things can improve,I am using this more than 1 year,Overall its a good product, very useful.Some minor drawbacks.,Great for vacuum, bad for mopping,Good product.,Product service issues,Good product,A helping hand for working women",
        "review_content": "My review of using new Vacuum Mop Pro 2 for 3 days...1. The product is a bit tricky to setup with the app and you have to follow YouTube videos to get it setup. I wish Xiaomi provides video tutorial links in their user manuals. They don't mention it but we need Bluetooth and WiFi connection to be setup, for the app and robot  to work together. This tip is missing in user manual.2. WiFi connectivity does get lost sometimes but that is because my router is far from certain places in my house. That time the robot needs to be brought back to the WiFi range. 5GHz connection does not work with this model.3. The robot takes anywhere between 40-60 minutes to completely vaccum my 800 sq. ft house. Battery life is really good in the new model. 50% or more is still left after one complete sweep or mop cycle of my house. Charging is also not bad. It took 1.5 hrs for it to charge full 100% the first time.4. Couple of times it got confused in a specific area in my house and I had to reset the entire house map for it to work properly again. Once the map was created and the device has sweeped and mopped that area for a couple of times, it would not repeat this behavior.5. Dusting is of A1 quality. Each time the amount of dust collected is staggering. We never knew we had so much dust in our house!6. Mopping is average. I would call it \"light wiping\" and not mopping. Hard stains or sticky stains or dry stains are not affected by the mopping. Only light dust or weak stickiness gets wiped out. Adding a bit of floor cleaning liquid or Vim liquid in the water helps.7. Vacuum + Mop mixed mode is limited in its effectiveness. In this mode, mopping sometimes wets the floor and causes dry dust to stick to the floor which the vaccum is not able to pick up.I recommend vacuum and mop as two separate cycles.8. Keeping mop extension attached to the robot all the time causes mopping cloth to accumulate dirt, and when it gets dragged along the floor it causes wet dirty mop to be wiped around the house. This is not ideal. So it's important to remove that extension from the vacuum bot when you are only vacuuming and not mopping.9. The mop works horribly on door mats (main door or bathroom mats). It gets very dirty when it moves over mats and then that wet dirt spreads all over the place. So please remove all the mats, esp. during mopping session.10. Noise levels are pretty low in medium mode. Sometimes we don't even know where it has gone, it gets so quiet.Pros.* Battery life* Suction power* Noise levels* VacuumingCons* Mopping is average. It's at best can be called as light wiping.* Setup is bit tricky, user manual is insufficient. Xiaomi does not contact or send any demo person at home. You have to figure it out using YouTube videos. I can see old people or non tech savvy people will highly struggle with this thing.* Once the device is confused it doesn't correct itself automatically. It needs a map reset.* Door mats make the mop even dirtier so please remove them or other items on the floor before mopping.Such tips nobody gives you and you have to learn them on your own.But I still recommend this device as it is very effective in sweeping the dust in the house clean.,ProsFor cleaning dust it is very good .we can set daily schedule.even if we forget to do so it will automatically does the work by setting schedule ...cleaning the box after its work is also not  very hectic..brushes are providing..We can set restricted areas.ConesMost of the hairs n threads are stuck through the round main brush.. little difficult to clear the brush.It has been more than 1 year iam using this.One time the movement is low .when ichecked..so many hairs are stucked in its wheel.it was little  difficult to clear the hair strands.Mopping it is average only..only takes very little amount of water.so oily things will remain in the floor..once or twice  in week we have to do mopping with plenty of water and lizol..It can't reach the sharp corners also.Once we create restricted area..by the time of using it couldn't detect the proper area we marked..so it enter those area and get stuck most of the times.it is main thing I hate about this product..remaining things are okay....then we have to reset the map and set restricted area again..it is bit annoyingOverall it is very good for me...my brooming is almost completely replaced by this ...once in week I do the complete cleaning with broom to all areas that didn't covered by this machine ..,In all other aspect like, price, battery,app feature, suction and cleaning its really very good product.I find it very useful and nice to have product.So will directly make note of  some drawbacks/improvent area, i observed.1) Sometimes it gets confused or leaves a specific section of bedroom even though there has been no obstacle.2) Its little noisy or I will say not a silent thing in standard suction power, though that with any vaccuum cleaner.3) Xiaomi could have provides extra Hepa filter with it.4) vaccum+mop doesn't clean properly and rather sticks dust to floor because of wet brush, so I do vaccum and then only mop subsequently is best option.5) Charging is super slow, if compared with any 5200mAh battery with mobile fast charger, its ~10 times slower despite such, a big docking charger.,I am a bachelor and i do not like Maid coming to my house.this solves the purpose. It is great at vacuuming my 2000 Sqft house. It can do it on turbo mode with dual cleaning in single battery life. was surprised with the vacuum power and battery life. It collects way more dust than the manual brooming.It can skip corners and narrow places. Once in a while i just broom the corners and bring the dust in the middle before turning the robot on.5/5 for navigation and room mapping.Mopping is equally bad. Mop does not cover whole area and it leaves trails. it leaves the floor looking worse than the un mopped floor. Also water tank broke in just few cleanings.Recommended for vacuuming purpose.,Very good product. Very helpful product in my home.,We purchased the product in April and now it is not working.After charging it is running for less than one minute and getting stopped,Easy to use and Working well little bit of noise is there but acceptable.,Helping hand. More reliable than maids. Does the job well. Once in 4 days you need to mop yourself. Good suction power.",
